import React, { Component, Fragment } from "react";
import ReactDOM from "react-dom";
import {
  HashRouter as Router,
  Route,
  Switch,
  Redirect
} from "react-router-dom";
import Register from "../src/component/accounts/Register";
import Login from "../src/component/accounts/Login";
import Dashboard from "./component/visions/Dashboard";
import { Provider } from "react-redux";
import store from "./store";
import Header from "./component/layout/Header";
import PrivateRoute from "../src/component/common/PrivateRoutes";
import { loaduser } from "./actions/auth";

export class App extends Component {
  render() {
    return (
      <Provider store={store}>
        <Router>
          <Fragment>
            <Header />
            <div className="container">
              <Switch>
                <PrivateRoute
                  exact
                  path="/"
                  component={Dashboard}
                ></PrivateRoute>
                <Route exact path="/login" component={Login}></Route>
                <Route exact path="/register" component={Register}></Route>
              </Switch>
            </div>
          </Fragment>
        </Router>
      </Provider>
    );
  }
}

export default App;
